INSERT INTO `binhluan` VALUES (1,'Lovely memories are in my hand!',NULL,1,1),(2,'a solid cheap phone for a backup',NULL,1,5),(3,'Timely arrival. Phone condition was as advertised. Life of battery seems to be OK. Only disappointment in moving it to my Verizon account was that the pictures I had on the phone wouldn\'t transfer to this one. Contact phone numbers transferred OK.',NULL,2,1),(4,'The supplier exceeded my expectations as the quality was even better than advertised and the phone go here quickly.',NULL,3,1),(5,'some features are difficult to find.',NULL,3,5),(6,'Phone didn’t work and never heard back from seller',NULL,4,1),(7,'Everything as expected, no problems. The case came separate from the phone, which was a little weird, but everything was in great condition and the phone works great.',NULL,5,1),(8,'I replaced my older RAZR V3m that I dropped on concrete with this exact duplicate. It\'s a great little phone if you don\'t want or need all the bells and whistled. And for the price, a very good deal.',NULL,5,1),(9,'Phone is fine, it works and looks good. No damage. Its just that the battery didn\'t hold a decent charge. You\'d think they would test the battery on it or leave notes saying battery isn\'t good.',NULL,6,1),(10,'The volume control never worked. Replacement sent and after 1 month white bar across the screen. Was cheap but not worth it all the time wasted and we ended up buying an unused/unopened phone from another seller. Customer service was good but product not.',NULL,7,1),(11,'Got this phone and the features in windows are awesome. No apple, no berries its just windows :) Just that the battery does not last long with 3G and wifi connected.',NULL,7,3),(12,'The one works. It smells like cigarettes. I bought it \"like new\". There\'s a numerous amount of deep scratches. & there\'s still photos from the orinial user that I cannot delete',NULL,8,1),(13,'Just looking at the price is shocking... These dinky phones were po',NULL,9,1),(14,'I really love this phone always have since Verizon first came out with the Motorola RAZR V3m. Nice and slim fits in my jeans pocket nicely. Great sound loaded with features. GREAT! AAA+++',NULL,10,1),(15,'The phone can not work very well. Battery runs out so fast. I need to charge it everyday even I didn\'t make any calls and receive any calls. My friends always complain a lot of noises. I need to switch to other Verizon phone to be able hear well.',NULL,11,1),(16,'Classic.',NULL,12,1),(17,'One of the best phones I have owned, this is my THIRD one ever since Motorola came out with it.',NULL,13,1),(18,'The phone was as describe. Great used condition and included the charger. The phone works perfectly and seems to have been very lightly used',NULL,14,2),(19,'This is the exact samd my wife had . Love this model for us the bakkery lasts a week!',NULL,14,4),(20,'Missing center button and no charger.',NULL,15,1),(21,'I bought this phone for my great aunt because it was something simple for her rather than the o ne she had at the time. It charges fast and the battery lasts all day. I recommend it to anyone who is looking for a simple easy to use flip phone',NULL,16,1),(22,'Absolutely pos ...had it not even week first day got it button came off second week another and today lost most and said good shape bs..then won\'t give me my money back sorry but it\'s such a POS I can\'t even send it back',NULL,17,2),(23,'Verizon would not connect phone because they only activate 4G phones. Had to return phone',NULL,18,2),(24,'Phone works good but was locked by previous owner. Phone could make and recieve contact calls only with previous contacts. After working 2.5 hours with three different verizon reps phone works fine.I feel i am due a partial refund from Taylor Wireless. Please advise?',NULL,19,2),(25,'Pretty much unkillable',NULL,20,2),(26,'This was a gift for my dad who can\'t get over his old phone breaking. He\'s not much of a tech person so I was psyched when I found the same phone here, since Verizon no longer has them for sale. The price was great and the phone looks flawless. Dad was really happy to have his old phone back.',NULL,21,2),(27,'Had one for 6years, some-what water proof and takes real beating. Hope this one lasts as long. With the same punishment, would have ruin 5 Smart phones by now.',NULL,22,2),(28,'had to replace my old barrage, quick deliverly and geat looking phone, works exactly as expected.',NULL,23,2),(29,'Bought this as a backup phone for my father and it worked out great for him as he wanted something durable.',NULL,24,2),(30,'Arrived on time, As Ordered, In Great Condition and was activated without issue. Great experience. Always liked Motorola because its durable and can take a beating',NULL,25,2),(31,'No good. The phone was very used.',NULL,26,2),(32,'Lost and gone forever the simple rugged cell phone, no matter the price this is obsolete and will leave you in need, sad.',NULL,27,2),(33,'not what I expected',NULL,28,2),(34,'I was pleased with this product. I came as advertised and works great. The battery is good and, with a little help from Verizon Wireless, I got it set up like a new phone.',NULL,29,2),(35,'Husband had his cell phone stolen, so we purchased this one until we could decide on next phone to purchase. He liked his other cellphone better.',NULL,30,2),(36,'Husband is happy with this. Very simple and just a phone.',NULL,30,5),(37,'The phone is great, since the other went in the pool to prove a point that it was water proof., but it was not .',NULL,31,2),(38,'it needs to be reprogramed and it seems to work better cuz it first dint even stay one for long turned on and off every minute.',NULL,32,2),(39,'Phone no longer charges new battery 100%. Swapped battery from other V860, but it still fails to charge 100%. The only way I have improved this failure is to turn the phone off, flip it open, then plugin and charge it while it is opened. Weird, but it works.',NULL,33,2),(40,'within days of receiving this phone in the mail. All of the problems I\'ve been having went away. The great improvement over the phone I had before. I hope this one lasts for a long long time.',NULL,34,2),(41,'This person/company shipped the phone on time and I received it a day earlier than I was promised. The phone was in better condition than I thought it was described as and I have not had one bit of trouble with it. YES I AM A HAPPY AND SATISFIED CAMPER WITH THIS TRANSACTION.',NULL,35,2),(42,'thanks',NULL,36,2),(43,'Exactly what I was looking for',NULL,37,2),(44,'I don\'t ask for much with a cheap prepaid phone like this. It does everything that it needs. I\'m satisfied.',NULL,37,5),(45,'Got this for my husband to use for work. It was our family\'s first and LAST Windows phone. Most of what he didn\'t like was Windows related. After a few months he started having trouble charging the phone, or the phone would quickly loose its charge. He switched back to Samsung S6 Android and loves that phone.',NULL,38,3),(46,'This is a good smart phone. It\'s not blotted with a lot of apps. The phone comes with windows 7 and will update to windows phone 7.5 or 7.8 depending which carrier you go with. My phone is running 7.8 and it works flawless. Yes this phone came out 3 years ago but it is still a very good phone!',NULL,39,3),(47,'Flip phones and pretty tough.',NULL,39,4),(48,'Wow, not a great product. I\'m an Apple guy, but surprisingly, i actually like the layout of this Windows phone! However, its battery life is terrible, and goes off by itself sometimes. Makes it really not worth it...',NULL,40,3),(49,'Great used phones.',NULL,40,4),(50,'Perfect Phone. Thanks. The AMOLED screen is awesome! Much better than the iPhone, HTC and Motorola displays. It truly is amazing and works good in all conditions including outdoors. The Samsung Captivate (android phone) also has the same screen. If fact, Samsung is now switching all their future phones to use AMOLED.',NULL,41,3),(51,'i had some issues with it at first, and i\'m a bit upset with the lack of apps, but all in all, it\'s a great phone, it\'s fast and very easy to use...so overall, a great purchase.',NULL,42,3),(52,'It came like new and everything was as described. The only downside about the phone is the OS, but it\'s not so bad.',NULL,43,3),(53,'Nothing against the seller, but this phone is so not what I needed. No reception versus the one I currently have that is older.',NULL,44,3),(54,'Good phone, however... small keyboard on the text messages No ability to make the keys bigger!!!! I wish I could fix this!!! Comment on this if their is a way to make the keys bigger',NULL,45,3),(55,'I\'m a bit unimpressed with this phone. I can\'t seem to access any of the apps and the battery dies very quickly.',NULL,46,3),(56,'This is really light, just got it for my bro and I am thinking whether to send it to him or tell him I am still looking.',NULL,47,3),(57,'This cellphone is incredible, is excellent, nice display, connection with exchange very simple, really is awesome. I can see all about your social networks, link contacts, play xbox games, listen music, the camera 5mp is wonderful',NULL,48,3),(58,'I can\'t download any aplication in it, i really don\'t know what is the trouble cause i have the ZUNE program in my laptop but nothing...',NULL,49,3),(59,'I have this phone for a few months, still working perfecly for every function. the only problem is that it\'s hard to connect to PC for updating system at very first time. I tried many PC, finally work at my old XP window PC. The other issues is windows phone has much less App.',NULL,50,3),(60,'It\'s a great device, faster and long battery life. The camara of 5 MB pixeles is fantastic.I strong recommend it',NULL,51,3),(61,'i love how easy it was to get to operate the phone and all the woderful functions that it can do.',NULL,52,3),(62,'This product is in perfect condition and I loved it when I got it. It lasts for forever and everything shipped right on time. I\'m happy with my purchase =)',NULL,53,3),(63,'For sure is not an Iphone, but is good to be different. The phone is fine, nice ad works good! Some good specs like radio and the camera',NULL,54,3),(64,'The phone works just that these phones keep messing up after awhile The buttons are so close I keep hitting other buttons instead. It\'s something to get use to.The range is wonderful, I live where it\'s hard to get out & this one is great never have any problems with that.',NULL,55,4),(65,'Awesome phone',NULL,56,4),(66,'bought this for my boyfriend and he is very happy with it.',NULL,57,4),(67,'Good Phone thanks :) it works great and was a much cheaper price than Verizon wanted for the same phone..',NULL,58,4),(68,'im having a lot of problems with this keeps cutting off on I have to keep taking the battery out and back in so it wiil power back up not happy...',NULL,59,4),(69,'the phone I got was a little more scratched then I thought it would be but the main problem I had with it is that it wasn\'t even cleaned up. it still had sticky hand prints all over it. realy?',NULL,60,4),(70,'The battery doesn\'t work. It wont hold a charge',NULL,61,4),(71,'Phone has good range. Was not new as advertised on web site, but is in good shape.',NULL,62,4),(72,'Was very pleased with the phone I received and the price was great. Glad I was able to find on line',NULL,63,4),(73,'great condition',NULL,64,4),(74,'My wife and I have each used these phones for over 2 years now. Mine has been dropped, kicked, and generally abused and still works great. I recently purchased \"2\" more for my mother and brother.',NULL,65,4),(75,'Its a good phone.',NULL,66,4),(76,'I got the Package today in the mail only to find just a charger and a battery. NO PHONE! So Mad!',NULL,67,4),(77,'Working great ! My mom still using!!',NULL,68,5),(78,'This was a replacement for my 3 year old cell and is better in almost every way than the last, both are Samsungs but this has better features and is faster than the last one. so far I\'m extremely pleased with it and I like the fact it cost less than the last.',NULL,69,5),(79,'I guess I just expected a phone that doesn\'t need to do much except call and text… to last a bit longer on the battery. 98% of its life is spent in standby, and it lasts less than 5 days. But then, what do you really want from a $14 phone. ;)',NULL,70,5),(80,'Simple and reliable. Perfect for a soldier in training and on the go. Everything I need to allow me to talk to my family on a daily basis. Great product.',NULL,71,5),(81,'Bought it for my dad and so far he says that he is very happy with the phone and that it helps him do what he needs which is make calls and send texts.',NULL,72,5),(82,'Can\'t believe it is so cheap. Great quality, great sound, long battery life, light weight, very durable - drop it as much as you want.',NULL,73,5),(83,'Nice cheap phone. Use for a backup on AT&T. Holds a charge nicely. Doesnt have an external display but knew that when I ordered it. Delivered on time. Would buy again. Exactly what I needed.',NULL,74,5),(84,'A surprisingly good inexpensive phone.',NULL,75,5),(85,'OK phone.',NULL,75,5),(86,'These are great and so cheap I bought 3 of them last year when best buy had them for $5 a piece. I\'ve used them when i was in between phones, and I also keep some in a first aid backpack because even without a phone plan they are able to call 911 in an emergency.',NULL,76,5),(87,'Really its worth for the money. Working perfectly with my At&T sim card. And I got a Brand new SIM card too with this.',NULL,77,5),(88,'I purchased this as an emergency phone to keep in the car while traveling, and for use on a pay-as-you go phone plan. It is inexpensive, has all of the basic functions, and works well. Compact, good battery life, good sound quality, sensitive. A good choice for basic use.',NULL,78,5),(89,'For a cheap no frills phone ,it works well enough and I like the flip but no camera.and my sims card did work but didn\'t show my contacts after inserting.',NULL,79,5),(90,'Phone quit working after a short period of time, not even worth a being a short-term phone. had to buy another/different phone',NULL,80,5),(91,'At this time and age, this phone is not practical. It seems I paid too much! But it works and it was new.',NULL,81,5),(92,'The same identical phone is selling at Walmart for $19.88!! The phone works great. Used to replace broken AT&T phone.',NULL,82,5),(93,'I purchased this phone to use with Airvoice\'s $10 per month plan and have no problems or complaints after a few months of use. You can use this on AT&T\'s prepaid plan or use any other prepaid carrier that uses AT&T\'s network (Airvoice and H2O Wireless for example).',NULL,83,5),(94,'Yo- Good reception - nice and loud and clear - just what I was looking for-eh!!',NULL,84,5),(95,'Bought this one for my travels in the US and am very happy with it. Can communicate at very low cost ($ 2 a day unlimited including internet) but would like it to have a longer validity for my credits (only 90 days). Still a very good value for my money...',NULL,85,5),(96,'Good work phone. Exactly as expected and reasonable price. Can\'t go wrong with a simple Samsung phone.',NULL,86,5),(97,'Great product and service.',NULL,87,5),(98,'Useful for the short time I needed it, but it\'s an old model.',NULL,88,5),(99,'My previous go-phone quit ringing, so I needed a replacement phone. Works perfectly for what I need, since I have minutes remaining in my plan.',NULL,89,5),(100,'I loved the style of this phone but the volume was not loud enough even when I turned it alll the way up I also could not hear the text messages I got',NULL,90,5),(101,'Bought as a replacement phone for prepaid. Easy to use and compact enough to put in a tight pocket.. Good buy for the price.',NULL,91,5),(102,'It\'s easy to use.',NULL,92,5),(103,'Wonderful basic phone just for texting, sending and receiving phone calls. Love this phone! Good investment. Can see using this phone for several years.',NULL,93,5),(104,'It is ok and it does what I need it for so I am happy with it, I only use cell phone for important things or emergency.',NULL,94,5),(105,'Nothing special about this phone, simple old school phone! Good for people who only want to make phone calls. I would not recommend if you like texting and internet.',NULL,95,5),(106,'This phone works very well. In fact when my husban lost his phone I ordered another one. Our sim cards worked right away from our own carrier. Would recommend to any one that needs to replace a phone fast.',NULL,96,5),(107,'This phone is crazy cheap and just works. The T9 input system isn\'t as good as with Sony Ericsson (my previous phone), but again, it\'s crazy cheap! Good battery life, good sound and reception. If you factor in the price you can upgrade everything to \"great\".',NULL,97,5),(114,'not bad',NULL,666,7);
